#' docs_proposal: ETH Board Open Research Data (ORD) Program Project Metadata and Report Data
#' 
#' This data package contains metadata and report data from 96 research projects funded by the joint Open Research Data (ORD) program of ETH Zurich, EPFL, and the four research institutes of the ETH Domain. The package includes project-level metadata, such as project titles, descriptions, and categorizations (Establish, Explore, Contribute), as well as data extracted from reports submitted by each project, providing insights into the projects' objectives, methods, outcomes, and impacts.
#' 
#' @format A tibble with 5 rows and 11 variables
#' \describe{
#'   \item{project_id}{A unique identifier for each project, represented as a numerical value.}
#'   \item{cost_personnel_senior_staff_fr}{The cost of personnel for senior staff in Swiss Francs (CHF), expected to be a numerical value.}
#'   \item{cost_personnel_postdocs_fr}{The cost of personnel for postdoctoral researchers in Swiss Francs (CHF), represented as a numerical value.}
#'   \item{cost_personnel_other_fr}{The cost of personnel for other staff members in Swiss Francs (CHF), represented as a numerical value.}
#'   \item{cost_personnel_students_fr}{The cost of personnel for students in Swiss Francs (CHF), expected to be a numerical value.}
#'   \item{cost_travel_fr}{The cost of travel expenses in Swiss Francs (CHF), represented as a numerical value.}
#'   \item{cost_equipment_fr}{The cost of equipment in Swiss Francs (CHF), represented as a numerical value.}
#'   \item{cost_publication_fr}{The cost of publication expenses in Swiss Francs (CHF), expected to be a numerical value.}
#'   \item{cost_social_fr}{The cost of social expenses in Swiss Francs (CHF), represented as a numerical value.}
#'   \item{cost_other_fr}{The cost of other expenses in Swiss Francs (CHF), represented as a numerical value.}
#'   \item{cost_subcontracting_fr}{The cost of subcontracting in Swiss Francs (CHF), represented as a numerical value.}
#' }
"docs_proposal"
